import React from 'react';

function TotalExpenses({ expenses }) {
  const total = expenses.reduce((sum, expense) => sum + parseFloat(expense.amount), 0);
  
  return (
    <div>
      <h3>Total Expenses: ${total.toFixed(2)}</h3>
    </div>
  );
}

export default TotalExpenses;
